def get_max_triples(n):
    A = [i*i for i in range(1, n + 1)]
    ans = []
    for i in range(n):
        for j in range(i + 1, n):
            for k in range(j + 1, n):
                if (A[i] + A[j] + A[k]) % 3 == 0:
                    ans.append((A[i], A[j], A[k]))
    return len(ans)

